import Typing from 'react-typing-animation'

const Index = () => (
    <div className='test'>
        <Typing>
            <div>
                <Typing.Delay ms={500} />
                <span className='bio'>
                    For CS students, by CS students.
            </span>
            </div>

        </Typing>

        <style jsx>{`
        h1,
        a {
          font-family: 'Arial';
        }
      `}</style>
    </div>
);

export default Index;
